import Link from "next/link";

const PodcastList = ({ audioClips, setOpenPodcast }) => {
  return (
    audioClips.map( clip => (
      <Link router="podcast"
        params={{
          slugChannel: slug(clip.channel.title),
          idChannel: clip.channel.id,
          slug: slug(clip.title),
          id: clip.id
        }}
      >
        <a onClick={e => setOpenPodcast(e, clip)}> { clip.title } </a>
      </Link>
    ))
  )
}

export default PodcastList;
